// 为 TFT_eSPI 库所创建的内存文件
//
// 图标建议尺寸 24x24 或 16x16
//
// 在线转化地址：
//  - http://rinkydinkelectronics.com/t_imageconverter565.php
//  - CloudConvert (可能有使用限制)
//  - https://tinypng.com/ (实际上没必要压缩，因为占的内存是一样的，像素宽高一样)
//  - https://www.online-utility.org/image/convert/to/XBM
//
// 图片转 XBitmap 貌似更小，试试质量如何。
// 黑白色，失真度较大。
// 建议图片还是老实 bitmap，图标可以用这个。图标也失真，别用 XBitmap。
// 不要用 png 转 bitmap，因为没有透明度概念，最好使用 jpg 格式。
//
// 中文生成 bitmap 数据，图标也可以用这个工具(有点儿失真)。
// https://www.zhetao.com/fontarray.html
//
// PROGMEM 是 Arduino 编程里的调用约定，指明该变量存储到 flash 中。
// https://reference.arduino.cc/reference/en/language/variables/utilities/progmem/
// 在 ESP32 系列里，声明为常量的变量一直都会被存储到 flash 中。
// https://esp32.com/viewtopic.php?f=13&t=4780
//
// 关于 esp32c3 能储存程序的大小，可以在开发板配置里的分区表里看到，
// 默认的是 1.2Mb APP/1.5Mb SPIFFS。建议的 2 个配置：
//    - mini spiffs 基本用不到 SPIFFS 功能
//    - huge app 最大化程序大小，适用于存了大量 bitmap
//      从分区表可以看到，不支持 OTA 无线升级，因为少了一个 app 分区下载固件。
//
// 还可以自己手动分区，参考上面两个配置，删除 OTA 和最小化 SPIFFS，
// 添加一个 .csv 然后放到 ESP32 库中，这样 IDE 就能直接加载，不过也
// 可以直接修改 huge_app.csv 分区表。
//
// 有关 spiffs
// 官方库 - https://github.com/pellepl/spiffs

